import Link from "next/link";

import styles from "../styles/index.module.scss";

const Index = () => {
  return (
    <div className={styles.container}>
      <div className={styles.logoLoginBanner}>
        <div>Logo IMG here later</div>
        <div className={styles.loginContainer}>
          <Link href="/login" className={styles.linkContainer}>
            <button className={styles.linkButton}>Admin</button>
          </Link>
          <Link href="/login">
            <button className={styles.linkButton}>Get Access</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Index;
